INSERT INTO `recipes` (`id`, `username`, `title`, `caption`, `ingredients`, `instructions`, `category`, `image`, `path`) VALUES
(18, 'faloula_atallah', 'Cheesecake', 'A bite of deliciousness.', 'Graham Cracker Crust:\n1 ½ cups graham cracker crumbs (170g)\n2 Tablespoons sugar\n1 Tablespoon brown sugar (can substitute white)\n7 Tablespoons butter melted\n\nCheesecake:\n32 oz cream cheese softened to room temperature (910g)\n1 cup sugar (200g)\n⅔ cups sour cream (160g)\n1 ½ teaspoons vanilla extract\n⅛ teaspoon salt\n4 large eggs room temperature, lightly beaten', '1. Preheat oven to 325F (160C).\n2. Prepare Graham Cracker crust first by combining graham cracker crumbs, sugar, and brown sugar, and stirring well. Add melted butter and use a fork to combine ingredients well.\n3. Pour crumbs into a 9” Springform pan and press firmly into the bottom and up the sides of your pan. Set aside.\n\nCheesecake\n1. In the bowl of a stand mixer or in a large bowl (using a hand mixer) add cream cheese and stir until smooth and creamy (don’t over-beat or you’ll incorporate too much air).\n2. Add sugar and stir again until creamy.\n3. Add sour cream, vanilla extract, and salt, and stir until well-combined. If using a stand mixer, make sure you pause periodically to scrape the sides and bottom of the bowl with a spatula so that all ingredients are evenly incorporated.\n4. With mixer on low speed, gradually add lightly beaten eggs, one at a time, stirring just until each egg is just incorporated. Once all eggs have been added, use a spatula to scrape the sides and bottom of the bowl again and make sure all ingredients are well combined.\n5. Pour cheesecake batter into prepared springform pan. To insure against leaks, place pan on a cookie sheet that’s been lined with foil.\n6. Transfer to the center rack of your oven and bake on 325F (160C) for about 75 minutes. Edges will likely have slightly puffed and may have just begun to turn a light golden brown and the center should spring back to the touch but will still be Jello-jiggly. Don\'t over-bake or the texture will suffer, which means we all suffer.\n7. Remove from oven and allow to cool on top of the oven³ for 10 minutes. Once 10 minutes has passed, use a knife to gently loosen the crust from the inside of the springform pan (this will help prevent cracks as your cheesecake cools and shrinks).\n8. Allow cheesecake to cool another 1-2 hours or until near room temperature before transferring to refrigerator and allowing to cool overnight or at least 6 hours. Enjoy!', 'sweet', '13961b63f5163dd6-201712-18761b63f4b76fdb-507875-10061b5da550c6bb-589605-19361b5d9a7a4655-600098-cheesecakejpegjpegjpegjpeg.jpeg', 'data:image/jpeg;base64,');
INSERT INTO `recipes` (`id`, `username`, `title`, `caption`, `ingredients`, `instructions`, `category`, `image`, `path`) VALUES
(26, 'faloula_atallah', 'Pasta Alfredo', 'Creamy, comforting, absolutely delicious, and super easy.', '8 ounce pasta I used linguini\n4 tablespoon butter unsalted\n2 cloves garlic minced\n1 1/2 cups milk\n1 cup heavy cream\n1/2 cup Parmesan cheese shredded\n1/4 teaspoon salt or to taste\n1/4 teaspoon pepper or to taste\n2 tablespoon fresh parsley chopped', '1. Cook the pasta according to the package instructions.\n\n2. Melt the butter in a large skillet over medium high heat. Add the garlic and cook for 30 seconds, or until fragrant.\n\n3. Pour in the milk and cream. Stir consistently to avoid burning on the bottom of the pan until the mixture comes to a boil. Turn the heat down to medium, and mix in the parmesan cheese, salt, and pepper. Adjust the seasoning to your own taste.\n\n4. Remove the pan from the heat and mix in the cooked pasta until the sauce begins to thicken. Garnish with parsley, and serve.', 'savoury', '9761b64c14b6a85-966119-alfredojpg.jpg', 'data:image/jpeg;base64,');
INSERT INTO `recipes` (`id`, `username`, `title`, `caption`, `ingredients`, `instructions`, `category`, `image`, `path`) VALUES
(27, 'faloula_atallah', 'Iced Caramel Latte', 'Make an iced caramel latte for a fraction of the price right at home!', 'Coffee: Use whatever coffee you have on hand, brewed strong if you want to really boost that coffee flavor. If you’d like to use a shot of espresso instead of coffee, just increase the milk in the recipe to 3/4 cup.\n\nMilk: Starbucks uses 2% milk in their coffee drinks, but you can use any milk you’d like including non-dairy milks. The higher fat your milk, the creamier your drink will be.\n\nCream: Cream is optional, but I love adding a little splash of it for extra richness. Feel free to substitute a splash of half and half if that’s what you keep on hand. And you’ll definitely have some leftover heavy cream, so check out my post What to Do With Leftover Whipping Cream for storage tips and recipe ideas for the leftovers.\n\nCaramel sauce: Use your favorite caramel sauce here. If caramel sauce isn’t something you keep stocked, pick some up the next time you’re at the store or make my quick shortcut caramel sauce.', '1. Pour hot coffee into a liquid measuring cup or any container with a lip for easy pouring. Stir in caramel sauce and sugar until completely dissolved. Add cold milk and optional heavy cream.\n\n2. Add ice to a 16-ounce cup and pour coffee mixture over the top of the ice.\n\n3. Top with whipped cream and more caramel sauce if desired, and enjoy!', 'drink', '13761b64ce43bbe8-570798-iced-caramel-latte-pic-1024x684jpeg.jpeg', 'data:image/jpeg;base64,');
INSERT INTO `recipes` (`id`, `username`, `title`, `caption`, `ingredients`, `instructions`, `category`, `image`, `path`) VALUES
(28, 'dareen_fayyad', 'Caesar Salad', 'Classic Caesar Salad with crisp homemade croutons and a light caesar dressing – for when you want to impress your dinner guests.', '- 1 large or 2 small heads of romaine lettuce\n- Parmesan cheese, shredded or shaved\n- Crisp croutons – homemade can be made several days ahead. The recipe below makes enough for 2 salads.', '- Cut baguette in half lengthwise and slice into 1/4″ thick pieces and place on baking sheet.\n- Combine 3 Tbsp extra virgin olive oil with minced garlic. toss breads with garlic infused oil and 2 Tbsp parmesan.\n- Spread Evenly and Bake to desired crispness.', 'salad', '6361b650ab9b896-234127-ceasersaladjpeg.jpeg', 'data:image/jpeg;base64,');
INSERT INTO `recipes` (`id`, `username`, `title`, `caption`, `ingredients`, `instructions`, `category`, `image`, `path`) VALUES
(29, 'dareen_fayyad', 'Pancakes', 'This is a great recipe that I found in my Grandma\'s recipe book. Judging from the weathered look of this recipe card, this was a family favorite.', '2 cups all-purpose flour\n2 teaspoons baking powder\n¼ teaspoon salt\n1 tablespoon sugar, optional\n2 eggs\n1 ½ to 2 cups milk\n2 tablespoons melted and cooled butter (optional), plus unmelted butter for cooking, or use neutral oil', 'Step 1\nHeat a griddle or large skillet over medium-low heat. In a bowl, mix together dry ingredients. Beat eggs into 1 1/2 cups milk, then stir in 2 tablespoons melted cooled butter, if using it. Gently stir this mixture into dry ingredients, mixing only enough to moisten flour; don\'t worry about a few lumps. If batter seems thick, add a little more milk.\n\nStep 2\nPlace a teaspoon or 2 of butter or oil on griddle or skillet. When butter foam subsides or oil shimmers, ladle batter onto griddle or skillet, making pancakes of any size you like. Adjust heat as necessary; usually, first batch will require higher heat than subsequent batches. Flip pancakes after bubbles rise to surface and bottoms brown, after 2 to 4 minutes.\n\nStep 3\nCook until second side is lightly browned. Serve, or hold on an ovenproof plate in a 200-degree oven for up to 15 minutes.', 'sweet', '3461b6513f7af83-806880-pancakesjpeg.jpeg', 'data:image/jpeg;base64,');

